import * as React from "react";
import Table from "@mui/material/Table";
import Box from "@mui/material/Box";
import Divider from "@mui/material/Divider";

import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";

function createData(handWash, exterior, interior, deluxe) {
  return { handWash, exterior, interior, deluxe };
}

const rows = [createData("$15", "$30", "$35", "$130")];

export default function BasicTable() {
  return (
    <Box>
      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Car
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Truck
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Divider></Divider>
    </Box>
  );
}
